import React, { useEffect } from "react";
import M from "materialize-css";
import { BrowserRouter, Route } from "react-router-dom";

import Home from "./Home";
import About from "./About";
import Services from "./Services";
import Gallery from "./Gallery";
import Contact from "./Contact";

const Parallax = () => {
  const imglink1 =
    "https://www.securitas.in/globalassets/india/images/general-images/top-images-1400-x-600/securitas-in-india_web_1440x600.jpg";
  const imglink2 =
    "https://i.pinimg.com/originals/d8/bb/3c/d8bb3c7f91d833d34a1c8e2f2bc21544.jpg";

  useEffect(() => {
    const elems = document.querySelectorAll(".parallax");
    M.Parallax.init(elems, {});
  }, []);

  return (
    <div className="row">
      <div className="col s12">
        <div class="parallax-container">
          <div class="parallax">
            <img src={imglink1} />
          </div>
        </div>
        <div class="section white">
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/services">
            <Services />
          </Route>
          <Route path="/gallery">
            <Gallery />
          </Route>
          <Route path="/contact">
            <Contact />
          </Route>
        </div>
        <div class="parallax-container">
          <div class="parallax">
            <img src={imglink2} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Parallax;
